    false,nt"url": null,nt"notes": "This Officer-Involved Shooting dataset
    provides the raw data needed to better understand the characteristics of these incidents
    in APD's jurisdiction and by APD officers. It is used to assist in identifying training
    and procedure improvements to improve outcomes.nnThis report reflects all officer-involved
    shootings that occurred from 2006 through 2015 in Austin. It includes incidents
    in which APD or non-APD officers fired their weapons within the city of Austin as
    well as incidents in which APD officers fired their weapons outside the city of
    Austin.nOfficer-involved shootings are defined as:n-an incident in which an officer
    fired his/her firearm intentionally at a subject;n-an incident in which an officer
    fired his/her firearm unintentionally and struck a subject; orn-an incident in which
    an officer used a less-lethal firearm, struck the subject, and contributed to the
    subjectu2019s death.nnnAUSTIN POLICE DEPARTMENT DATA DISCLAIMERn1. The data provided
    is for informational use only and is not considered official APD crime data as in
    official Texas DPS or FBI crime reports.n2. APDu2019s crime database is continuously
    updated, so reports run at different times may produce different results.  Care
    should be taken when comparing against other reports as different data collection
    methods and different data sources may have been used.n3. The Austin Police Department
    does not assume any liability for any decision made or action taken or not taken
    by the recipient in reliance upon any information or data provided.",nt"license_title":
